package io.enscene.topophone.dao.hardcoded;

import io.enscene.topophone.dao.MainDao;
import io.enscene.topophone.model.main.Main;

import java.util.Optional;

import javax.inject.Singleton;

import com.google.common.collect.ImmutableList;

@Singleton
public class MainDaoHardCoded implements MainDao {

  @Override
  public Optional<Main> get(Optional<String> version) {
    return Optional.of(new Main(ImmutableList.of(), getDescription(), getDemarche()));
  }
  

  private String getDemarche() {
    return "<h2 class=\"title\">Notre démarche</h2><img onload=\"this.__gwtLastUnhandledEvent=&quot;load&quot;;\" src=\"http://topophone.fr:8080/Topophone/clear.cache.gif\" style=\"width: 450px; height: 125px; background: url(data:image/png;base64,) no-repeat 0px 0px;\" border=\"0\" class=\"GDPD4GNAL\">";
  }
  

  private String getDescription() {
    return "<h2 class=\"title\">Topophone en quelques mots</h2><p>Topophone promeut une musique <span class=\"bold\">basée sur l'échange et l'ouverture<br> à l'autre.</span></p> <p>Elle accompagne et diffuse des artistes en s'appuyant sur un réseau de partenaires professionnels de la musique. En parallèle, elle mobilise ses artistes sur la réalisation d'actions culturelles et éducatives auprès de structures scolaires et périscolaires.</p>";
  }

}
